import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the first "Add to Cart" button to ensure there is an item in cart
    await page.waitForSelector('button.add-to-cart:not([disabled])', { timeout: 5000 });
    await page.click('button.add-to-cart:not([disabled])');

    // Wait for cart counter to update (cart count is in #cartCount)
    await page.waitForSelector('#cartCount', { timeout: 5000 });

    // Open the cart modal by clicking the cart area
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal to appear and for a cart item to be present
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // Take screenshot after opening cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Extract the title of the first cart item before removal for verification
    const cartItemTitle = await page.$eval('.cart-item .cart-item-title', el => el.textContent.trim());

    // Remove the first item from the cart by clicking its "Remove" button
    await page.waitForSelector('.cart-item .remove-item', { timeout: 5000 });
    await page.click('.cart-item .remove-item');

    // Wait for either the cart to be empty or the cart item to be removed
    // If only one item, expect .empty-cart to appear; otherwise, .cart-item-title should change
    let cartEmpty = false;
    try {
      await page.waitForSelector('.empty-cart', { timeout: 3000 });
      cartEmpty = true;
    } catch {
      // If not empty, wait for the cart item title to change
      await page.waitForFunction(
        (oldTitle) => {
          const el = document.querySelector('.cart-item .cart-item-title');
          return !el || el.textContent.trim() !== oldTitle;
        },
        cartItemTitle,
        { timeout: 3000 }
      );
    }

    // Take screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

    // Extract cart state after removal
    let cartState;
    if (cartEmpty) {
      cartState = 'empty';
    } else {
      cartState = await page.$$eval('.cart-item .cart-item-title', els => els.map(e => e.textContent.trim()));
    }

    return {
      success: true,
      action: "Removed an item from the cart using the cart modal",
      extractedData: {
        removedItemTitle: cartItemTitle,
        cartStateAfterRemoval: cartState
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
